var atx=[];
atx[10]="С ДНЕМ РОЖДЕНИЯ! Движение Солнца к положению рождения будет указывать на положительные импульсы во всех отношениях.",
atx[110]="Гармоничное аспектирование между Солнцем и Солнцем возвещает об увеличении жизненной силы и трудоспособности. Различные импульсы извне и собственные идеи будут теперь приведены в действие. Физическая и духовная конституция будут теперь на высшем уровне, резко повысится уверенность в себе.",
atx[210]="В случае, когда Солнце расположено неблагоприятно к Солнцу, возможны различные нарушения здоровья. В такие моменты не следует принимать важных решений, так как в состоянии неуверенности в cебе можно легко допустить ошибку.",
atx[11]="Соединение Солнца c Луной является благоприятным моментом для мужчин, так как благоприятно воздействует на их здоровье и сексуальную активность. У женщин в такой период возможно нарушение здоровья.",
atx[111]="Период благоприятный для гармонии и мира, психика будет находиться в такое время в состоянии уравновешенности и в фазе полной стабильности. Все проблемы кажутся решенными, чувствуется оживление, постоянное пребывание в приподнятом настроении, и можно от всего сердца радоваться жизни. В любовных и дружеских отношениях будет преобладать лучик тщеславия. Так как в это время очень благоприятно заводить новые контакты, то период данного аспекта будет располагать к новым знакомствам.",
atx[211]="Прохождение Солнца через дисгармоничные аспекты Луны в радиксе гороскопа будет указывать на душевный разлад и нарушения здоровья. Больные будут чувствовать себя еще хуже, а здоровые будут ощущать себя не в форме. Поскольку такое прохождение Солнца возвещает об общих сложностях и предстоящих проблемах, то не следует в это время браться за решение сложных вопросов.",
atx[12]="Транзиты Солнца через гармоничные аспекты Меркурия являются благоприятным отрезком времени для принятия ясных, разумных и существенных решений. В такой период следует браться за подготовку и проведение деловых контактов всех видов, а также торговых сделок и переговоров о совместной работе. Благоприятный период для опубликования рекламных объявлений и агитационной кампании.",
atx[112]=atx[12],
atx[212]="Несобранность и нервозность во время таких транзитов может привести к провалу деловые переговоры. Этот период будет весьма неблагоприятным для начала переговоров, подписания векселей или планирования любого вида работ. Из-за ошибочного суждения и принятия ошибочных решений возможны несогласия и размолвки в личной жизни и на работе.",
atx[13]="Транзит Солнца через гармоничные аспекты Венеры указывает на период внутренней уравновешенности и гармонии. Дружеские отношения станут еще доверительнее, обеспечен успех в общественной жизни, а также в любовных отношениях все будет склоняться в положительную сторону. Люди искусства почувствуют побуждение к новым творческим работам. Чтобы полностью использовать этот благоприятный период, необходимо во время гармоничного транзита Солнца/Венера находиться в обществе других людей.",
atx[213]="Несобранность и нервозность во время таких транзитов может привести к провалу деловые переговоры. Этот период будет весьма неблагоприятным для начала переговоров, подписания бумаг или планирования любого вида работ. Из-за ошибочного суждения и принятия ошибочных решений возможны несогласия и размолвки в личной жизни и на работе.",
atx[14]="Недостаточная уверенность в себе создает для человека некоторые проблемы. И лишь тогда, когда гармоничный аспект между Солнцем и Марсом в радиксе-гороскопе будет преобладающим, данный человек сможет направить свою излишнюю энергию в правильное русло.",
atx[114]="Повышенная энергичность и жизнерадостность будут способствовать преодолению всех препятствий. Динамично будут использоваться все предоставленные возможности, любая инициатива в этот период будет благоприятной для начала предпринимательской деятельности, которую необходимо выполнить в короткий срок. В этот период возрастает тенденция к заключению более тесных партнерских отношений между представителями другого пола.",
atx[214]="Когда Солнце находится в транзите в результате квадратуры или оппозиции радикса Марса, то такое положение может привести к сильному психическому перенапряжению, которое может служить причиной неправильных действий и конфликтных ситуаций. Человеку будет очень тяжело преодолеть свою агрессивность и, слишком усердствуя, он может перешагнуть за пределы доступного. Возрастает тенденция к перенапряжению. В такой момент он должен не позволять втягивать себя в какие-либо конфликтные или противоречивые ситуации, необходимо будет приложить всю свою выдержку, терпение, сдержанность и подчинение внутренней саморегуляции. В это время растет тенденция к простудным заболеваниям с повышенной температурой.",
atx[15]="При своем прохождении через гармоничный аспект радикса Юпитера Солнце будет указывать на фазу превосходного состояния здоровья и психической стабильности. Стремление к достижениям и к власти будет обуславливать выраженный порыв к экспансии, который может реализоваться в социальной сфере. В целом транзиты должны нести радость, счастье, уверенность и надежность, а также шансы для удачного завершения. Эти дни считаются благоприятными для социальных отношений, переговоров с властями или с высокопоставленными социальными служащими, а также для женитьбы, финансовых операций и правовых актов. У больных происходит заметный прогресс в лечении болезни.",
atx[215]="Слишком сильное проявление эмоций может вызвать различные столкновения. Происходит снижение творческих импульсов, работоспособность почти на нуле, в этот период также очень легко преступается грань закона, предписаний или же нравственности. Человек склонен делать ненужные конфликты, в деловых кругах возможны большие убытки из-за неправильной оценки данной ситуации. Те, кто хотел похудеть, должны быть особенно осторожными: дисгармоничное расположение Юпитера благоприятно не только для алкогольных эксцессов, но и для эксцессов, связанных с неумеренным питанием.",
atx[16]="Пессимизм, депрессии и огорчения в течение данного транзита приводят  в состояние апатии. Следствием этого будут вялость и недостаточная решимость, что должно отодвинуть на длительный период принятие важных решений. В этот период будет снижена также физическая витальность и защитные функции организма, поэтому особенно повышенным будет рост инфекционных заболеваний. Во время этого неблагоприятного солнечного транзита дадут о себе знать и многие хронические заболевания.",
atx[116]="Гармоничные транзиты Солнца указывают на период выдержки, спокойствия и концентрации. Отодвинутые на длительный период дела в такие дни могут быть благополучно разрешены. Таким же благоприятным этот период будет для планирования долгосрочных проектов на будущее, однако в это время следует быть благоразумнее, осмотрительнее и настойчивее. Для окончательного успешного завершения дела хорошо было бы воспользоваться советом опытного старшего товарища.",
atx[216]=atx[16],
atx[17]="Прямое прохождение Солнца через радикс Урана в большинстве случаев оценивается негативно; исключительно при соответствующем положении радикса Солнца и Урана возможно возникновение такого напряженного положения, которое в последний момент может закончиться благополучно.",
atx[117]="Транзиты Солнца через гармоничные аспекты тригона и секстиля будут воздействовать в целом возбуждающе на деятельность нервной системы: человек прямо-таки брызжет идеями и выдумками, настроен творчески и полон радости жизни. Те вопросы, которые ему не удавалось решить в течение длительного времени, несмотря на интенсивное обдумывание, внезапно получали удовлетворительные ответы, так  как  они уже  имеют иную  перспективу, прежде.",
atx[217]="Сильная нервозность и раздражительность во время такого транзита предвещает возможную опасность от несчастного случая, особенно в автокатастрофе или же при пользовании бытовой электротехникой. Для предпринимательской деятельности, которая требует от человека самодисциплины и выдержки, эти дни будут совершенно неподходящими.",
atx[18]="Очень эмоциональные люди во время таких транзитов оценивают несколько необъективно окружающую ситуацию и поэтому легко становятся жертвами собственной фантазии. Их быстрая подверженность чужому влиянию делает из них очень быстро жертвы обмана или интриг, поэтому в течение данного времени им не следует вести какие-либо деловые переговоры или завершать их. Им следует быть очень осторожными с составлением доверительных соглашений и не говорить ничего такого, что потом могло бы быть истолковано как ложь. В такой период следует применять медикаменты строго по предписанию врача, а во время приема лекарств следует особенно избегать алкоголя и других приятных отрав.",
atx[118]="Только тогда, когда Нептун займет в радиксе-гороскопе доминирующую позицию, или же будет подчеркнут другими аспектами, данные транзиты будут воздействовать через гармоничные радикс-аспекты: они будут благоприятными для определенного погружения в себя и для одухотворенности, тем самым гармонизируя полностью личность человека. Одновременно будут расти его фантазия и восторженность, что приведет к страстному желанию достичь далеких пределов, которые могут быть из сфер космоса или духовности.",
atx[218]=atx[18],
atx[20]="Если Меркурий транзитирует через гармоничные аспекты Солнца, то это будет указывать на фазу повышенной творческой активности, которая будет проявляться в зависимости от духовного потенциала человека в разработке новых идей, в правильном использовании своего таланта, а также полученных знаний в своей профессиональной деятельности или же в работе по совместительству. Этот период считается наиболее благополучным для деловых переговоров, подписания соглашений или же для творчества во всех сферах интересов человека.",
atx[120]=atx[20],
atx[220]="Транзиты Меркурия через квадратуру или аспект оппозиции Солнца всегда сопровождаются нервозностью, рассеянностью и раздражительностью. Для умственного труда данный период является крайне неблагоприятным. Это же относится и к установлению контактов с близкими людьми: отсутствие взаимопонимания, притворство, лицемерие, заблуждение и обман станут основными пунктами разногласий.",
atx[21]="Транзит Меркурия через аспекты соединения, тригона и секстиля Луны предвещает об изменениях в жизни человека, которые могут быть как быстро проходящими, так и более продолжительными и затрагивать как профессиональные сферы деятельности человека, так и его быт, а также его отношения с партнером. Это всегда приводит к улучшению обстоятельств жизни.",
atx[221]="Транзиты Меркурия через дисгармоничные аспекты радикса указывают на фазу раздражительного настроения и безынициативности. При помощи эмоций человек пытается уклонится от интеллектуальных и профессиональных запросов, неуверенно принимает решения, в целом занимает выжидательную позицию.",
atx[121]=atx[21],
atx[22]="Данный гармоничный транзит будет наиболее благоприятно воздействовать на весь процесс умственной деятельности. Поток духовных ассоциаций будет способствовать изложению как в письменной, так и в устной форме, а способность быстрого усвоения позволит правильно использовать предоставленные шансы. В этот период особенно выгодно могут завершиться посреднические сделки.",
atx[122]=atx[22],
atx[222]="Транзиты Меркурия через дисгармоничные аспекты радикса обуславливают ограничительное воздействие на ясность ума. Заблуждения, ошибки по невнимательности и недостаток логики будут приносить вред не только профессиональной деятельности, но и вносить негативные изменения в личную и общественную жизнь человека. Не следует в этот период заниматься ответственными делами, а также следует стараться до минимума исключить личные контакты. Предпринимать какие-либо поездки в этот период тоже не рекомендуется.",
atx[23]="Гармония между чувством и разумом, чувство жизнеутверждения и уверенности сопровождают всегда данный транзит. Присутствует ощущение юношеской беззаботности, а также чувствуется влечение к представителям другого пола, возможно завязывание любовных связей. В любом случае эти дни будут благоприятными для отдыха, хобби, коротких поездок и для визитов.",
atx[123]=atx[23],
atx[223]="Прохождение Меркурия через дисгармоничные аспекты радикса ведет к дисгармонии между разумом и чувствами. Возможно распространение необоснованного оптимизма, человек становится легкомысленным, у него появляется желание заниматься спекуляцией, а также желание развлекаться, что будет вести к ненужным финансовым затратам. В течение этого транзита возможны некоторые расстройства в межчеловеческих взаимоотношениях, особенно это будет проявляться в сфере общественных отношений.",
atx[24]="Нервозность, неумение сконцентрироваться, беспокойство, раздражительность и агрессивность толкают человека во время таких дисгармоничных транзитов к поспешным, необдуманным действиям, неуместной критике или провокационному поведению в кругу своих близких. Недопустимо в такие дни вести переговоры любого рода, а при общении с другими следует постараться собрать всю свою сдержанность.",
atx[124]="В течение этого транзита превосходнейшим образом гармонируют интеллект и воля. человек полон духовных замыслов, горит желанием заняться предпринимательской деятельностью, очень быстро принимает решения, однако не пренебрегает при этом возможностью подвергнуть все критическому анализу, разумно планирует и быстро осуществляет свои дела. Итак, очень благоприятные дни для деловых переговоров, профессиональных начинаний, финансовых сделок и посредничества любого вида, а также для личных бесед и завязывания новых контактов.",
atx[224]=atx[24],
atx[25]="Прохождение Меркурия через соединение, тригон и секстиль Юпитера указывает на период разумного практицизма и прекрасных идей: итак, благоприятные дни для письменного общения, посреднической деятельности, торговли, подписания договоров, улаживания различных дел с властями и бизнеса любого рода.",
atx[125]=atx[25],
atx[225]="Недостаток решительности, необдуманность поступков и неуверенность делают из человека плохого партнера по переговорам. В этот период не рекомендуется заключать какие-либо деловые сделки или же развивать какую-либо деятельность, требующую дисциплины.",
atx[26]="Во время этого дисгармоничного транзита человек испытывает чувство полного недоверия, ведет себя эгоистично, чувствует себя заторможенным и оскорбленным и настроен весьма пессимистично на будущее, в большинстве случаев из-за собственной ошибки.",
atx[226]=atx[26],
atx[126]="Концентрированное, серьезное и конкретное мышление является основанием для не очень быстрого, однако довольно-таки продолжительного успеха в узко ограниченной сфере деятельности. Вследствие чего человек достигает успеха в результате концентрации в узкой, ограниченной сфере, благодаря экономнейшему использованию финансовых средств и благоразумию. Во время данного транзита будут благоприятными обучения любого рода, а также завязывание новых отношений, которые должны быть продолжительными.",
atx[27]="Прямое прохождение Меркурия через радикс Урана почти во всех случаях оценивается положительно и именно в тех областях жизни, которые будут указаны положением радикса в домах. Неблагоприятные дни для переговоров, путешествий, переписки и финансовых дел.",
atx[127]="Мимолетные мысли, новые и оригинальные идеи, интуиция и вера в прогресс предоставляют человеку возможность распознать новые шансы для дальнейшего успеха, найти выход из ситуации, которая ранее казалась неразрешимой, или же использовать свои открытия с пользой, что потом будет приносить ему прибыль.",
atx[227]="Возбудимость, нервозность и ненужная раздражительность могут привести к расколу духовных сил, в результате чего возможны различные неудачи. Из-за собственной невнимательности возможны несчастные случаи. Неблагоприятные дни для различных изменений, обновлений, совместной работы или путешествий.",
atx[28]="Ослабление функционирования нервной системы приводит также к уменьшению ощущения реальности. Во время данного транзита человек склонен обманывать своих близких и людей, его окружающих, он плетет против них интриги или же стремиться их оговорить, обмануть или оболгать. В целом это неблагоприятные дни для общественных контактов, переговоров или решения задач, когда необходимо заглянуть в самую сущность дела.",
atx[228]=atx[28],
atx[128]="Транзиты Меркурия через гармоничные аспекты радикса делают интеллект более восприимчивым для тончайших токов. В этот период преобладает воздействие вдохновения и разума, постоянно присутствующее чувство наступающего развития поможет настроить стрелки на будущее. Для людей интеллектуального склада эти дни будут наиболее благоприятными для творческого развития, для натур, склонных к искусству, путешествия послужат поводом для вдохновения.",
atx[30]="Человек в течение этого периода ощущает внутреннюю свободу и раскрепощенность, он испытывает чувство радости и уверенности в себе, поэтому он ощущает симпатию и влечение к окружающему миру. Он ищет в этот период душевности, посещает друзей и пытается найти в жизни самые лучшие стороны. Это будет идеальный период для дружеского общения, для любви, брака и семейной жизни, для всего прекрасного и эстетичного, для социальной активности и для всего, что связано с домом, через который в данный момент проходит Венера. Особенно благоприятным можно считать соединение, заключение союза. Эти даты будут благоприятными для покупки вещей, которые относятся к предметам роскоши, а также для улаживания общественных и финансовых дел.",
atx[130]=atx[30],
atx[230]="Повышенные сексуальные потребности и непостоянство настроения во время данного дисгармоничного транзита Венеры могут принести вред отношениям между партнерами, а также разлад в семье: непонимание друг друга (часто необоснованная ревность) станут причиной напряженной обстановки, которая в конце концов может привести к разводу. Кроме того в этот период человек склонен к ненужной растрате денежных средств. В этот период характерна также потеря чувства реальности, которое проявляется обычно в мысленных желаниях.",
atx[31]="Когда Венера находится в транзите через гармоничные аспекты радикса Луны, человеком овладевает сильная потребность в гармоничных контактах с представителями другого (или того же) пола, а также общении в дружеской компании. В своих чувствах человек настроен на нежность, ласковость и мягкость, а заботы о собственной популярности принесут успех в обществе. Это благоприятные дни для путешествий, различных перемен или же для улаживания каких-либо тайных обстоятельств.",
atx[231]=atx[31],
atx[231]="Неуравновешенность и неуверенность во время этого транзита резко осложняют жизнь человека. К этому добавляется еще отсутствие взаимопонимания с партнером или же в семье, неудачи в бизнесе и финансовые неудачи. Данный транзит является типичным транзитом любовных огорчений, он предотвращает разлуку. И в других отношениях эти дни будут неудовлетворительными.",
atx[32]="Во время благоприятного транзита Венеры через гармоничный аспект Меркурия в радиксе человек бывает особенно эмоционален и очень утонченно воспринимает окружающий мир. Это позволяет ему осуществлять установление различных контактов и завязывать интересные знакомства. В это время человек склонен посвятить себя эротическим, общественным и эстетическим интересам.",
atx[232]="Невежество и дурное настроение делают период этого транзита неблагоприятным для любовных отношений. Гармония в семейных отношениях может быть нарушена, на работе и во время каких-либо поездок могут возникать небольшие огорчения, межчеловеческие контакты будут затруднены из-за отсутствия взаимопонимания. Нависает угроза финансовых затруднений.",
atx[33]="Повышенная сентиментальность во время данного транзита делает человека восприимчивым к искусству. Готовность и желание быть откровенным и сердечным по отношению к другим делает этот период благоприятным для различных контактов, визитов, душевного общения и фамильярного поведения, а потребность в нежности обуславливает влечение к представителям другого (или того же) пола. Особенно интенсивно в этот период воздействие соединения.",
atx[133]=atx[33],
atx[233]="Транзит Венеры через собственные дисгармоничные аспекты радикса приводит к несколько напряженной ситуации в эротической области. Все желания остались невыполненными, на удовольствия было слишком много израсходовано, работа и хобби не приносят никакого удовлетворения, общение, не принесло желаемого отвлечения.",
atx[34]="Сильная раздражительность и неумение владеть собой толкают человека в этот период дисгармоничного транзита Венеры на создание сложностей в семейных отношениях и социальной сфере. Эти дни будут неблагоприятными для переговоров, личных деловых контактов, для сложной работы и для всех тех дел, где необходимо обдумывание предстоящего холодной и ясной головой. Если одновременно будут происходить еще некоторые транзиты, которые будут указывать на самообладание и самоконтроль человека, то такое прохождение может усилить инстинктивные предрасположенности, но одновременно может способствовать предотвращению конфликтного взрыва.",
atx[134]="Темперамент и витальность являются основными результатами воздействия этого гармоничного транзита Венеры. Человек пытается выйти из собственных пределов, настроен оптимистически, развивает сексуальную активность, интенсифицирует свое отношение к партнеру. Своим поведением с шармом очаровывает окружающих, любой флирт имеет шанс на успех, и в целом в это создается время климат ощущения жизнерадостности и удовлетворения.",
atx[234]=atx[34],
atx[35]="Транзит Венеры, проходящей через гармоничные аспекты Юпитера, приводит человека в приподнятое, взволнованное настроение. В этот период заключаются дружеские отношения, любовные желания находят свое воплощение, решительно в лучшую сторону происходят изменения в семейных отношениях. Вдохновение в области искусства находит свое творческое выражение, правовые, финансовые или управленческие дела будут улаживаться безо всяких затруднений. Это дни счастья, гармонии чувств и наслаждения, но также хозяйственной экспансии или ускорения текущих проектов.",
atx[135]=atx[35],
atx[235]="Слишком оптимистические или слишком грандиозные намерения соблазняют в течение этих дисгармоничных транзитов Венеры на излишнюю доброту, расточительность, нереалистичное планирование или коммерческие дела с неоправданным размахом. В течение этих дней человеку следовало бы приложить волевые усилия, так как он явно пресыщается едой и алкогольными напитками или же совсем не соблюдает диету. Из-за собственного легкомыслия возникает опасность понести убытки, а столь поверхностный образ жизни ведет к конфликтам с окружающими людьми. Только при достаточном самообладании и при одновременных транзитах, способствующих укреплению силы воли, возможно начальную неудачу обратить к некоторому улучшению.",
atx[36]="Во время такого дисгармоничного транзита человек старается уйти в себя. Добровольно он изолирует себя от общества и погружается в пессимизм и депрессию. Он отказывается от радостей жизни, постоянно бывает всем недоволен, теряет всякую энергию и инициативу. Близкие ему люди оказываются под воздействием его отрицательного настроения, они постоянно ощущают на себе действие отрицательных эмоций, при встрече человек демонстрирует им холодность своих чувств и неприкрытый сарказм. Следующими отрицательными проявлениями данного транзита являются ненависть, сварливость, намерение расстаться и нарушение здоровья.",
atx[236]=atx[36],
atx[136]="Во время данного транзита чувства подчиняются разуму, поэтому ошибочные эмоциональные реакции почти исключаются. Такой реалистический настрой обуславливает сохранение верности своему партнеру, а также развитие текущих дел и завершение финансовых сделок. Однако человеку рекомендуется в течение этого периода придерживаться морального кодекса, соблюдать традиции и не поддаваться желанию спонтанного изменения существующего состояния.",
atx[37]="Повышенная инстинктивность и внезапные страстные порывы обуславливают во время данного транзита необычность и эксцентричность поведения в любви, человек прямо-таки охвачен своими чувствами и бесконтрольно отдается страстям, что нередко может принести вред его репутации.",
atx[237]=atx[37],
atx[137]="Повышенная восприимчивость и аффектированная чувствительность во время данных гармоничных транзитов ведут к спонтанному, скачкообразному и часто оригинальному отношению к партнеру. В эротическом и сексуальном плане возможно появление новых и сильных импульсов, которые во всяком случае не будут продолжительными.",
atx[38]="Неуверенность и сверхэмоциональность ведут во время данных дисгармоничных транзитов к заблуждению, разочарованию, самообману и неосуществимым иллюзиям. человек ощущает себя обойденным в этот период своим партнером, семьей, друзьями, коллегами по работе или же деловыми партнерами, обижается на всех или же реагирует недоверчиво.",
atx[238]=atx[38],
atx[138]="Транзиты Венеры через гармоничные аспекты Нептуна указывают обычно на фазу повышенной чувствительности и интуиции. В эти дни пробуждаются эстетические потребности, говорит о себе тоска по дальним странствиям, а творческое вдохновение располагает к образному выражению.",
atx[140]="Возрастание физической активности и уверенности в себе.  Эти дни удачны для проявления собственной инициативы, решительных действий и попыток обратить себе на пользу усилия других, однако не теряйте голову. Возможна эффективная работа, деловые прорывы.",
atx[40]=atx[140],
atx[240]="Нехватка жизненной силы и собственной инициативы или импульсивные, непродуманные действия. Вероятны резкие и агрессивные реакции, поэтому конфликты с людьми и неудачи в делах. Избегайте ссор, будьте внимательны (есть опасность бытовых травм).",
atx[144]="Повышенная энергия и позитивный взгляд на жизнь. Благоприятно для проявления инициативы, новых начинаний, а также действий, требующих интенсивных затрат труда и преодоления препятствий. Если вам нужна будет помощь, она появится. Возможна повышенная склонность к конфликтам, истинной целью которых служит утверждение своей позиции. ",
atx[44]=atx[144],
atx[244]="Ощущение нехватки энергии или неконтролируемая энергия и понижение способности самообладания. Возможны конфликты, ведущие к подрыву сил. Будьте осторожны с инструментами, машинами и огнем. Повышена предрасположенность к инфекциям и головной боли. Не следует перенапрягаться, проявлять агрессивность и спешку. Тяжелые дела и решительные действия лучше отложите или, если можете, удвойте усилия.",
atx[141]="Активизируется эмоциональная жизнь и романтическое настроение. Не сдерживайте эмоциональные порывы, наслаждайтесь жизнью. В своих действиях вы будете руководствоваться инстинктом и интуицией. Также это удачные дни для улаживания бытовых вопросов, домашних дел и т.п.",
atx[241]="Эмоциональное нетерпение, отсутствие умения владеть собой приводят к ссорам. А события вряд ли пойдут гладко. Следует сдерживать раздражительность. Нервное возбуждение может негативно отразиться на функции желудка и эндокринной системы. Уменьшается работоспособность,  поэтому не планируйте на это время решение трудных задач.",
atx[41]=atx[241],
atx[142]="Повышенная активность ума и концентрация, прилив энтузиазма, а также контактность и предприимчивость. Дни удачны для умственной и творческой деятельности, начала новых дел, быстрых решений, контактов, переговоров, сдачи экзаменов.",
atx[42]=atx[142],
atx[242]="Ослабление способности концентрироваться, внутреннее беспокойство, нервозность, повышение критического настроя. Поспешные поступки, спорные ситуации, полемика - не в вашу пользу. Неудачные дни для контактов, переговоров, деловых предприятий и экзаменов. ",
atx[143]="Эмоциональная наполненность, энтузиазм, элегантность, стремление к гармонии, проявление темперамента. Дни хороши для творческой работы и проектов, а также  отдыха, развлечений и встреч с друзьями и любимыми.",
atx[43]=atx[143],
atx[243]="Возможен недостаток внимания к чувствам других людей, несдержанность, нехватка тонкости в поведении и конфликты. Легкомысленность,  желание пустить все на самотек, небрежное отношение к собственным обязанностям и нравственным принципам в этот период приведут к неприятным последствиям. Светские события, общение с партнерами пройдут не совсем гладко.",
atx[145]="Жизнерадостность, оптимизм и позитивный настрой. Удачные дни для социальной активности, деловых проектов, инициатив, демонстрации и укрепления своего престижа и авторитета (рост по службе, расширение собственного дела и др.)",
atx[45]=atx[145],
atx[245]="Завышенная самооценка, амбициозность, переоценка своих сил, необдуманные действия и агрессивность приводят к конфликтам и проблемам. Это неблагоприятные дни для новых начинаний, серьезных деловых бесед и сделок, выяснения вопросов с начальством, споров в суде и доказательства своего авторитета. Будьте благоразумны или перенесите все это на другой более удачный период.",
atx[146]="Возрастает способность концентрации, ответственность, готовность собрать все силы, чтобы добиться цели. Благоприятно для эффективной работы, достижения результатов и успешного выполнения взятых на себя обязательств или начала длительных проектов. Время способствует заслуженному признанию, благодаря вашему терпению, зрелости и опыту или помощи человека с такими качествами.",
atx[246]="Физическое напряжение или тяжелый труд. Подавленное состояние, пессимизм или чрезмерное стремление завершить все дела и добиться результатов. Возможны профессиональные проблемы из-за нехватки времени или опыта, болезни и травмы. Избегайте работы рывками, а также конфликтов с начальством, властями или старшими по возрасту людьми. Наберитесь терпения и не унывайте: все не так плохо, как кажется в это время.",
atx[46]=atx[246],
atx[147]="Повышенная активность, ощущение полной свободы действий и стремление к новаторству. Вероятно желание выйти за пределы ограничений, спонтанные поступки, смелые, быстрые и оригинальные решения. Это время удачно для научного поиска, творчества,  для сложных проектов, которые необходимо быстро провернуть. Возможны неожиданные события или резкое изменение хода вещей, но это не принесет вам неприятностей.",
atx[247]="Нервные перегрузки, повышенная раздражительность и импульсивность действий. Навязчивые идеи, неприятные сюрпризы, внезапные потери. Этот период неудачен для деловых предложений и новаторских проектов - могут помешать неожиданные факторы. Возможно переутомление и бессонница, есть опасность травм и несчастных случаев. Будьте внимательны и избегайте стресса. ",
atx[47]=atx[247],
atx[148]="Возрастают интуитивные способности и чувствительность. Мечты, фантазии, прогрессивные идеи. Благоприятное время для уединения, творчества, погружения в себя и выражения чувств, общения с природой и духовно близкими людьми. Но будьте осторожны: употребление спиртного без меры и чрезмерная эйфория может привести к потере сил и депрессии.",
atx[248]="Рассеянность, иллюзии или обман, ощущение психической усталости и недовольства, разочарование в окружающем мире и неэффективность в работе. Вам может быть выражено недоверие и предъявлены упреки в безответственности. Острегайтесь клеветы и избегайте лжи. Старайтесь преодолеть расслабленность, неорганизованность и витание в облаках. Иллюзии, нереальные желания и спонтанные поступки, которые в эти дни, скорее всего, кажутся логичными и реальными, приведут к потерям. Алкоголь и т.п. противопоказан.",
atx[48]=atx[248],
atx[149]="Энергичность, риск, принципиальность и смелость, физические и моральные усилия, рост возможностей контролировать,  управлять, добиваться более влиятельного положения. Благоприятные дни для аналитической и исследовательской работы, проведения проектов по реконструкции, реорганизации и трансформации организаций, процессов, отношений и т.д. ",
atx[249]="Интенсивная энергия в эти дни провоцирует к борьбе за власть, зависти и жажде мести. В это время попытки изменить или оспаривать существующее положение вещей, манипуляции и антагонизм, скорее всего, окажутся напрасной тратой сил и времени.  Придерживайтесь честной, но осторожной линии поведения, это может и не приведет вас сейчас к успеху, но представит вас в более выгодном свете. С масштабными деловыми проектами тоже лучше повременить. Также будьте бдительны: высока опасность болезни, травмы или аварии. ",
atx[49]=atx[249],
atx[150]="Оптимизм, успех, уважение и признание со стороны окружающих. Судьба приносит подарки - обстоятельства складываются в вашу пользу. Это ваш период взлета. Действия будут достигать цели, начинания будут успешными. Хорошое время для роста и перемен, перехода на новую более престижную работу, повышения, начала и расширения своего дела.",
atx[50]=atx[150],
atx[250]="Препятствия на пути к успеху из-за собственного упрямства, гордости, тщеславия, алчности и переоценки своих возможностей. Использование своего авторитета и доказывание своей правоты, скорее всего, приведут к конфликтам. Постарайтесь быть максимально объективными. Могут быть осложнения в переговорах, юридических и финансовых вопросах. Не благоприятно начинать новые проекты. ",
atx[155]="Время успеха и широких возможностей. Усиление чувства собственного достоинства и осознание собственной значимости и достижений. Удачное время намечать жизненные перспективы. Благоприятный период для устройства социальных дел и решения юридических вопросов. Ваши начинания и преобразования получают поддержку, что позднее приведет к благополучию. ",
atx[55]=atx[155],
atx[255]="Неприятные ситуации и препятствия из-за переоценки собственных сил, завышенных планов или ошибочно выбранных путей к цели. Избегайте завышенного самомнения, эгоистичного самооправдания, цинизма и конфликтов на этой почве. Возможно неопонимание на идейной почве, юридические проблемы и неудачи в общественной деятельности. Не ждите подарков в этот период, будьте бдительны и объективны.   ",
atx[151]="Благоприятные обстоятельства для эмоционального выражения, гостеприимства или визитов, что может принести друзей и популярность. Гармоничный период для любой работы, контактов, переговоров, деятельности в поле зрения общественности.",
atx[51]=atx[151],
atx[251]="Повышеная эмоциональность, импульсивность, необъективность и нетерпение.  Сложно взаимодействовать с людьми, поэтому нелучшее время для общения или публичной деятельности. Не стоит давать воли эмоциям. Будьте осторожны в обещаниях: они могут оказаться невыполненными.",
atx[152]="Удачный период для любой интеллектуальной деятельности, обучения, контактов с людьми и отношений со средствами информации и связи. Общение активизируется, масса информации, мнений и идей. Это время благоразумных решений, благоприятное для заключения договоров, публикаций, поездок и командировок, покупок. ",
atx[52]=atx[152],
atx[252]="Вероятны: неверная информация, недостаточное внимание к деталям, поспешные выводы, торопливые поступки. Опоздания, непрактические покупки и безалаберные действия. Будьте терпеливы, внимательны и благоразумны, чтобы избежать проблем в общении, деловых контактах, или в поездках. ",
atx[153]="Счастье, комфорт, материальные блага и твердая почва под ногами. Обострение вашего чувства юмора, способности радоваться жизни и сотрудничать с окружающими. Удачное время для творчества, душевного общения, светских событий, деловых и романтических союзов. В целом, процветание во всех отношениях.  ",
atx[53]=atx[153],
atx[253]="Потеря оптимизма. Жизнь не приносит удовольствия. Возможны лень, расточительность, легкомысленность и потакание слабостям. Успех в делах, связанных со всеми видами партнерств, или со светскими событиями, не обещает быть легким: будьте настойчивы, честны и доброжелательны, избегайте излишеств.",
atx[154]="Прилив энергии, энтузиазм и обширная конструктивная деятельность. Удача, прогресс и выгода в делах. Даже явные поражения могут обернуться удачей. Выполнение сложных задач упростится. Хорошо начинать новое. Не позволяйте инерции мешать вашей предприимчивости.",
atx[254]="Неуверенность в себе или завышенная самооценка и превышение пределов своих возможностей. Преувеличенное чувство собственной значимости как компенсация ощущения нестабильности своей позиции. Возможны неудачи из-за собственных неверных действий. Избегайте риска, конфликтов, будьте сдержаны в поступках и осторожны в решениях.",
atx[156]="Серьезность и ответственный подход в делах. Хорошее равновесие между оптимизмом и осторожностью. Прогресс в серьезных и долгосрочных проектах. Также хорошо их планировать и-или начинать. Ответственное отношение к жизни и обязанностям благотворно влияют на статус и репутацию. Возможно заслуженное признание за упорство, терпение и ответственность. Возможна поддержка от людей, обладающих опытом, авторитетом или властью.",
atx[256]="Возможны проблемы, отсрочки и материальные трудности, может страдать репутация из-за ошибок и просчетов в прошлом. Возможно повышенное чувство своей вины за происходящее. Будьте осторожны в делах и бизнесе, не пренебрегайте своими обязанностями, лучше не нарушать законы, нормы и правила, не стоит перекладывать ответственность на других.",
atx[157]="Новые возможности для интеллектуальной деятельности, повышения образования или путешествий. Благоприятно для поиска новых форм социального самовыражения, свежих идей, новых проектов и определения перспектив. Ваши идеи и оригинальные решения получат поддержку. Хорошо для реформ и преобразований, требующих быстрого воплощения в жизнь. Возможны неожиданные удачи и приятные сюрпризы.",
atx[257]="Сверхоптимизм, недостаток здравого смысла и практичности, слишком поспешные решения и непредсказуемые результаты. Не хватает организации и дисциплины. Новые проекты, идеи и решения могут не находить признания. Будьте объективны и внимательны, тщательно проверяйте все свои выводы. ",
atx[158]="Ощущение гармонии жизни, вдохновение, интуиция, творческое воображение и сочувствие. Желание ускользнуть от тусклой суеты. Период удачен для развития восприимчивости и тонкости ощущений, понимания красоты музыки и живописи, для медитации и духовных поисков, путешествий с религиозными целями. Это хороший период для людей гуманитарных и творческих профессий. ",
atx[258]="Мечтательность, рассеянность, непрактичность. Возможны трудности из-за иллюзий, нереалистических ожиданий или обмана и интриг. Постарайтесь быть объективны, остерегайтесь заманчивых предложений, не злоупотребляйте лекарствами и алкоголем. ",
atx[159]="Расширение личного влияния, хорошая внутренняя опора и склонность принять на себя лидерские обязанности или решение финансовых вопросов. Возможен успех в крупномасштабных научных и деловых проектах. Благоприятный период для общественной  деятельности и реформ. Возможен интерес к самосовершенствованию и трансформации, изменения в мировоззрении.   ",
atx[259]="Возможны финансовые и юридические проблемы, переутомление. Конфликты из-за попыток доминировать и контролировать других, реформировать отношения или организации. Остерегайтесь грандиозных и сомнительных проектов и идей, не переоценивайте свои возможности.",
atx[56]=atx[156],
atx[57]=atx[157],
atx[58]=atx[158],
atx[59]=atx[159],
atx[160]="Самообладание, контроль и выдержка. Настойчивость, организованность и ответственность, проявленные в прошлом, могут принести заслуженное вознаграждение (рост, повышение, признание), а в настоящем - будут основой будущего успеха. Хорошее время для упорной работы, серьезных и долгосрочных проектов, основанных на трезвом расчете и приобретенном опыте. Благоприятный период исправить, учесть ошибки прошлого. Можно отдохнуть от суеты и определить цели на будущее.",
atx[260]="Кризис. Пониженная жизнеспособность, усталость, депрессия, неуверенность в себе.  Препятствия, отсрочки, осложнения. Обременительные обязанности мешают самовыражению. Настойчивость и усердие могут не дать желаемых результатов, а замыслы могут не осуществиться. Нет признания со стороны влиятельных лиц. Суровость и черствость к другим как результат самозащиты. Использование личной власти и авторитета в эгоистических целях приводит к конфликтам. Не поддавайтесь нетерпению и унынию, это период испытаний: необходимы труд, дисциплина и организованность.",
atx[166]="Рассудительность, терпение, организованность и дисциплина помогают преодолевать препятствия и достигать результатов. Благоприятный период для того, чтобы  принять на себя серьезные обязанности, требующие осторожности и зрелости. Хорошо начинать или завершать серьезные и долгосрочные проекты. Хорошее время для подведения итогов и определения ориентиров на перспективу. Полезны занятия психологией или философией в целях самопознания и осмысления полученного в жизни опыта.",
atx[266]="Пессимизм, депрессия, сомнения, упадок сил. Разочарования, отсутствие выбора, задержки, обременительные обязанности, препятствия для роста и успеха. Возможно проявление отрицательных черт характера: упрямство, недоброжелательность, нетерпимость. Возможны ситуации, подрывающие авторитет, конфликты с влиятельными лицами. Неблагоприятный период для принятия ответственных решений и начала дел, от вас потребуется больше усилий, чем вами ожидалось. Не унывайте, сохраняйте терпение. Самопознание поможет пережить кризисное время. ",
atx[161]="Психическая стабилизация, спокойствие, внутренняя уравновешенность, самоосмысление и практический подход. Хорошее время для принятий решений и действий, опирающихся на зрелость и опыт или требующих терпения и ответственного подхода, для решения повседневных задач. Возможна помощь, содействие, совет опытных людей или авторитетных лиц. Используйте это время для осмысления прошлого и закладывания основ для будущего.",
atx[261]="Депрессия, уныние, негативный настрой. Замкнутость, инертность и заторможенность. Повышенная потребность в защите и, как следствие, жалость к себе и чувство отверженности. Трудности, задержки, неудачи. Пониженная жизнеспособность: возможны проблемы со здоровьем. Спад активности, деловые и домашние проблемы. Неудачное время для серьезных начинаний. Не поддавайтесь унынию, наберитесь терпения, обратитесь внутрь себя в поисках нового фундамента для будущего роста.   ",
atx[162]="Умственная концентрация, практическое мышление, рассудительность, сообразительность и благоразумие. Благоприятный период для серьезного общения, планирования, целеустремленной работы или учебы. Хорошо для контактов, деловых проектов и торговли, научной, образовательной, литературной деятельности. Новые начинания приведут к успеху в будущем, или прежние усилия принесут свои плоды в это время. ",
atx[262]="Трудно сконцентрироваться, отсутствие вдохновения, умственное напряжение, нервозность, нетерпеливость, пессимизм. Критический настрой, безинициативность, проблемы в общении, нехватка времени, отсрочки и неприятности.  Это не самый благоприятный период для коммуникаций, торговли, любой интеллектуальной деятельности и деловых проектов. Неудачное время для покупок и путешествий. Не поддавайтесь унынию, будьте терпеливы, избегайте излишней критики и самокритики, а также лжи и обмана.   ",
atx[163]="Эмоциональная стабильность, собранность чувств и серьезность отношений. Хорошее время для выработки своего стиля, творчества, а также строительства, дизайна и работы по дому. Возможно установление длительных деловых и творческих взаимоотношений: союзам и партнерствам, начатым в это время обеспечены успех и долголетие. Хороший период для значимых и важных светских событий : сочетайте полезное с приятным.",
atx[263]="Возможны холодность, отчужденность, напряженность чувств, разочарования и неудачи в отношениях. Светское общение может быть в тягость. Эгоистичность и недостаток внимания к чужим чувствам. Возможны затруднения в общественной и творческой деятельности. Вероятна напряженность в партнерстве. Необходимы усилия с вашей стороны для того, чтобы наладить сотрудничество и/или придти к примирению.",
atx[164]="Самореализация, честолюбие, выдержка, решимость преуспеть, хватка, практические достижения через дисциплину, ответственность и труд. Благоприятное время для профессиональных начинаний и завершения долгосрочных проектов с получением долгожданных результатов. Благоприятный период для энергичных действий, рассчитанных на перспективу, и административных усилий. Хорошо продумайте свои планы и организуйте свой труд.",
atx[264]="Период жизненных трудностей и болезней. Помехи, задержки и затруднения в делах. Склонность к агрессивности, вспыльчивости, нетерпению и недоброжелательности приводят к конфликтам, недовольству начальства или властей. Действия наперекор и кажущиеся кратчайшие пути к цели не дадут ожидаемого эфФекта. Вероятны нервные перегрузки и стрессовые состояния, не исключены опасные случаи травмы. Будьте осторожны, не поддавайтесь гневу и унынию. Препятствия ведут к успеху, если вы принимаете вызов. Вам поможет терпение и серьезный, основательный подход к делу.",
atx[165]="Рост и устойчивость в делах. Серьезный и ответственный настрой. Баланс между оптимизмом и осторожностью. Период удачен для профессиональной деятельности и повышения квалификации, а также для этического и философского осмысления жизни. Хороший период для планирования, начала или завершения долгосрочных проектов, смены и/или расширения деятельности (места работы), расширения влияния и упрочения авторитета, улаживания юридических вопросов, отношений с начальством и органами власти. ",
atx[265]="Возможны личные и материальные проблемы, моральный кризис, препятствия и задержки на пути к интеллектуальным достижениям, социальному успеху и духовной самореализации. Вероятна переоценка своего авторитета, слишком жесткая позиция и несоразмерные требования к обществу и окружению. Либо, наоборот, неуверенность в себе и сомнения будут препятствовать успеху. Период потребует от вас объективности, терпения, ответственного и основательного подхода к жизни. Не пренебрегайте важными обязанностями и этическими принципами.",
atx[167]="Концентрация и интуиция. Увлеченность и практичность. Благоприятный период для серьезной интеллектуальной работы, для изучения и практического применения новых и оригинальных идей, методов и технологий, для быстрого реформирования существующих структур, а также для выхода на новый уровень мастерства в своей профессии или открытия в себе новых способностей и смены профессии. Возможны нетривиальные решения сложных проблем. Проявляйте уникальность и неординарность - это должно найти поддержку и не встретит препятствий.",
atx[267]="Кризис, неприятные сюрпризы, неожиданные трудности и задержки. Препятствия в практическом применении новых и оригинальных идей, методов и технологий, возможно разочарование в попытках реализовать свои цели и перспективы, желание снять с себя ответственность. Вероятны конфликты - ваши идеи и начинания не находят ожидаемой поддержки. Возможны неприятности со здоровьем, нервные расстройства, травмы. Сохраняйте терпение и объективность, будьте осторожны, смысл происходящего может раскрыться позднее.",
atx[168]="Вдохновение и практичность, чувствительность и уверенность. Благоприятный период для людей творческих профессий, когда вдохновение может принести осязаемые плоды. Интуиция помогает решить сложные задачи, стабилизировать и углубить отношения, преодолевать иллюзии и обман, выявить скрытых недоброжелателей и рассеить интриги. Это плодотворный период для психологической работы, самопознания, духовной практики. ",
atx[268]="Душевный дискомфорт, психическая нестабильность, иллюзии, самообман. Хаос и неразбериха, тайны, загадки, непонятные дела, интриги недображелателей или нежелательное раскрытие ваших собственных тайн.  Не подавайтесь влиянию настроения, не пренебрегайте обязанностями, будьте максимально честны с собой и другими, избегайте жалости к себе, мрачных мыслей и фатализма. Откажитесь от алкоголя и т.п. средств. Будьте осторожны с лекарствами.",
atx[169]="Стойкость, выдержка, самоконтроль, энергичность и выносливость. Удачный период для принятия ответственности за необходимые и сложные задачи, участия в глобальных проектах или процессах и т.п. Возрастает умение справляться с кризисными ситуациями, применять по необходимости силовые методы. Благоприятное время для серьезных и глубоких преобразований в делах и организациях. Возможно расширение полномочий и авторитета. ",
atx[269]="Кризис, тяжелый труд, опасные ситуации, роковое стечение обстоятельств, отсутствие выбора. Возможно вовлечение не по своей воле в глобальные проекты и процессы, кризисные и опасные ситуации, борьбу за власть и т.п. Неблагоприятный период для начала серьезных и сложных дел, принятия ответственности. Будьте осторожны, возможны травмы и аварии. Сохраняйте терпение и конструктивный настрой, достойно примите трудности, не прибегайте к сомнительным средствам для достижения целей.",
