atx[170]="Озарение, творческий взлет, устремленность в будущее и расширение горизонта, счастливый случай, стремление к свободе и оригинальности. Возможны непредвиденные события, необычные возможности, знакомства и сотрудничество с интересными людьми и их поддержка. Удачный период для проявления самобытности и уникальности. Хорошее время для начала и реализации оригинальных и новаторских проектов. Могут удастся самые невероятные планы и реализоваться несбыточные надежды. ",
atx[270]="Кризис, внезапные перемены и неожиданные трудности. Не хватает свободы, светлые перспективы разрушаются. Непоследовательность, легкомысленность и эксцентричность могут привести к конфликтам и проблемам. Неблагоприятный период для принятия серьезных решений и перемен. Есть опасность перевозбуждения, нервного срыва, психического истощения.",
atx[177]="Новые жизненные перспективы, неожиданные и спонтанные события, новые возможности и знания, освобождение от прошлого и изменения в мировоззрении. Стремление к переменам и проявление оригинальности находят поддержку и понимание. Удачный период для творческих начинаний и прогресса во всех сферах жизни.",
atx[277]="Идейный кризис, поиски и перемены, которые бывают у всех людей в возрасте около 21, 42 и 63 лет. Неудовлетворенность жизнью и желание свободы любой ценой приводит к конфликтам и проблемам в отношениях и делах. Непредвиденные жизненные обстоятельства, новые цели и роли требуют существенных изменений в мировоззрении. ",
atx[171]="Чувство внутренней свободы, раскрепощение чувств, повышение чувствительности, спонтанность реакций, свежесть и новизна впечатлений. Воображение и интуиция. Благоприятный период для творчества и изменений в повседневной жизни, домашних делах и привычках. Возможны приятные сюрпризы: могут исполниться мечты.",
atx[271]="Неожиданные перепады настроения и капризы, возбуждение и беспокойство, неожиданные обстоятельства, внезапные перемены вкусов и привязанностей. Все привычное надоедает, возникает желание немедленно изменить жизненные обстоятельства, быт и окружение, начать новую жизнь. Это может привести к проблемам, конфликтам и нервному напряжению. Постарайтесь избегать поспешных импульсивных действий и попытайтесь разумно подойти к решению проблем.",
atx[172]="Легкость и оригинальность мышления, яркие и гениальные идеи, откровения и озарения. Быстрота реакции, изобретательность, ясность и свобода мысли. Неожиданные знакомства и контакты, свобода и спонтанность в общении. Успех в коммерческих проектах, покупках и продажах. Отличное время для интеллектуальных занятий, контактов и путешествий, особенно благоприятно для научной работы и литературной деятельности.  ",
atx[272]="Нервозность, беспорядочность и импульсивность в мышлении и решениях, путаница в идеях, бумагах, разговорах и спорах, ошибки, плохие вести, неприятные сюрпризы, странные знакомства и контакты, неожиданные препятствия в коммуникациях. Оригинальные решения и открытия не находят применения и признания. Неконкретность и субъективность создает препятствия в делах и контактах. Будьте внимательны и рассудительны, избегайте поспешных и необдуманных решений, возможны ошибки. Избегайте перенапряжения: возможны нервные срывы.",
atx[173]="Яркая эмоциональная жизнь, оригинальное самовыражение, творческий подъем и раскрепощение, желание романтики и приключений, поиск новых ощущений и отношений, новое понимание любви и красоты. Благоприятное время для творчества и сотрудничества, возможность воплотить свои романтические надежды и фантазии. Удачное время для проектов в индустрии красоты, комфорта и развлечений, светских мероприятий, призванных произвести фурор.",
atx[273]="Сверхэмоциональность и импульсивность, нереалистичные мечты и фантазии, неудачные романтические увлечения, излишняя тяга к удовольствиям, аморальность, авантюризм, чрезмерные траты денег и сил, напряженность и разлад в отношениях, конфликты. Оригинальные творческие проекты, проекты сотрудничества или проекты в сфере красоты, комфорта и развлечений не находят поддержки или встречают неожиданные препятствия. ",
atx[174]="Творчество и оригинальность в действиях и решениях. Энергичность, уверенность в себе и желание свободы проявления. Возможны новаторские начинания, изобретения и научные открытия. Благоприятное время для инноваций, конструктивных преобразований и всех дел и проектов, требующих быстрых и нетривиальных решений и действий.  ",
atx[274]="Нервозность, беспокойство, повышенная раздражимость, желание свободы любой ценой, импульсивные поступки и действия, внезапные конфликты, споры и ссоры, разрыв отношений. Неожиданные препятствия в делах, оригинальные и новаторские проекты не находят применения. Существует опасность аварий, несчастных случаев, травм. Возможно нервное перенапряжение. Будьте осторожны с техникой, избегайте чрезмерного риска.",
atx[175]="Открытие новых перспектив, расширение сферы интересов, поиск новых впечатлений и знаний, перемены в мировоззрении, обретение новых жизненных ориентиров. Неожиданный успех, рост авторитета, известность, благополучие, новые возможности реализовать свой потенциал. Благоприятный период для перемен во внешней жизни и духовной практики.",
atx[275]="Сверхоптимизм, нетерпеливость, нереалистичный взгляд на вещи, желание свободы без ответственности, возможен бунт против существующего порядка и идеалов, разочарование в жизни. Риск и потери. Неожиданные проблемы и трудности, возможна потеря авторитета.",
atx[176]="Неожиданный, но заслуженный успех. Увлеченность и практичность. Целеустремленность и выдержка. Свобода и ответственность. Благоприятный период для серьезной интеллектуальной работы, для новаторства и реформирования, для выхода на новый уровень мастерства в своей профессии или открытия в себе новых способностей и смены профессии. Возможны резкие повороты в сознании и судьбе, которые определят последующие несколько лет.",
atx[276]="Кризис, существенные потери и утраты, потеря ориентиров, болезненное разрушение стереотипов и отказ от прошлого, внутренние противоречия, конфликт между свободой и ответственностью. Роковые собы­тия и происшествия заставляют переосмыслить жизненные ценности. Возможна тенденция к саморазрушению, активизация хронических болезней, имеется опасность несчастных случаев. ",
atx[178]="Озарение и вдохновение. Творчество и духовность. Возможно развитие интуитивных и паранормальных способностей, освобождение от иллюзий и лжи. Благоприятный период для творчества, научной и гуманитарной деятельности, духовной практики. ",
atx[278]="Духовный кризис, дезориентация, хаос, возможен самообман и неоправданные фантазии, неожиданные и странные ситуации, проблемы из-за интриг, лжи, мошенничества, тайных недоброжелателей. Странные, непонятные собы­тия и происшествия заставляют переосмыслить жизненные ценности и идеалы. ",
atx[179]="Сила и уверенность, способность найти выход из самой сложной ситуации, радикальные изменения и преобразования в себе и окружении. Судьбоносные и глубокие перемены. Вовлечение в массовые процессы и успех. ",
atx[279]="Если этот аспект имеет особое значение в вашем гороскопе возможен глобальный кризис, непредсказуемые, фатальные события и экстремальные ситуации. Если нет, то вы можете быть вовлечены не по своей воле в какие-то массовые процессы или стать свидетелем неких опасных и чрезвачайных ситуаций, а можете этот аспект не заметить вовсе. ",
atx[70]=atx[270],atx[71]=atx[271],atx[72]=atx[172],atx[73]=atx[273],atx[74]=atx[274],atx[75]=atx[275],atx[76]=atx[276],atx[77]=atx[277],atx[78]=atx[278],atx[79]=atx[279],atx[180]="Вдохновение, чувствительность, одухотворенность, расширение сознания, идеализм, возвышенная любовь, сострадание, гармония, расслабленность, принятие жизни такой как она есть. Возможно прикосновение к божественному, вечному, обретение веры, тайного знания, интерес к религии, мистике и эзотерике. Удачный период для творческой деятельности и духовных практик.",
atx[280]="Склонность к иллюзиям и самобману, недоверие и ненадежность, неопределенность и дисгармония, потеря ориентиров, возможны непонятные и необъяснимые явления и события. ",
atx[188]="Вдохновение, чувствительность, одухотворенность, расширение сознания, идеализм, возвышенная любовь, сострадание, гармония, расслабленность, принятие жизни такой как она есть. Возможно прикосновение к божественному, вечному, обретение веры, тайного знания, интерес к религии, мистике и эзотерике. Удачный период для творческой деятельности и духовных практик.",
atx[288]="Духовный кризис, эмоциональный хаос, потеря веры в прежние идеалы и трудный поиск новых, изоляция и бегство от реальности, иллюзии и самобман, проблемы из-за интриг и лжи. Постарайтесь избегать рассеянности и неразумных действий, неискренности и лжи. Будьте очень осторожны с алкоголем и лекарствами. ",
atx[181]="Усиление интуиции и восприимчивости, психологической проницательности, ощущение гармонии и красоты, возвышенная любовь, мечтательность и расслабленность. Возможны возвышенные душевные переживания, чувство единства с миром, сострадание и желание заботиться о других. Удачный период для творческой деятельности, помощи другим людям и духовного поиска.",
atx[281]="Психическая нестабильность, хаос в чувствах и эмоциях, сильные перепады настроения, усталость и раздражитльность, неприятные воспоминания и впечатления. Возможны иллюзии и самообман, безответственность и бегство от реальности, повышенная внушаемость. Снизить стресс и гармонизировать чувства поможет гармоничная музыка, пребывание на природе, изучение психологии, самопознание и духовная дисциплина. Будьте очень осторожны с алкоголем и лекарствами. ",
atx[182]="Творческая интуиция и озарение, усиление способностей к воображению и образному мышлению, синтезу идей и представлений, чутье к информации и контактам. Благоприятный период для литературного творчества, исследовательской работы, психологических и философских занятий.",
atx[282]="Иллюзии, навязчивые идеи, необъективность, рассеянность, невнимательность, забывчивость, суета, переутомление. Остерегайтесь мошенничества, сплетен, лжи, обмана и ошибок в контактах и бумагах.",
atx[183]="Вдохновение, полет фантазии, мир, спокойствие, благополучие, гармония, возвышенная любовь, романтика, новые надежды. Благоприятный период для творчества, сотрудничества, любви и благотворительности.",
atx[283]="Эмоциональная неудовлетворенность и поиск сочувствия, жажда переживаний и разочарования, обманчивые мечтания, иллюзии, тайная или безответная любовь, творческие но часто безрезультатные устремления, самообман и иллюзии в отношениях. Избегайте излишеств в удовольствиях и денежных тратах.",
atx[184]="Творческая активность, хорошее время для воплощения своих идеалов или фантазий в конкретные действия. Благоприятный период для исследований неизвестного или тайной и закулисной деятельности, реализации творческой энергии, психоэнергетических практик и духовных усилий.",
atx[284]="Кризис, снижение творческой активности, разочарования и подавленность, инертность, неясность целей, саморазрушительные тенденции. Возможен обман и  интриги в профессиональных делах, апатия, рассеянность и низкая эффективность. Есть опасность труднодиагностируемых болезней, инфекций, несчастных случаев на воде или отравления. Будьте осторожны с химическими и лекарственными препаратами. Не допускайте излишеств в алкоголе.",
atx[185]="Творческое и религиозное вдохновение, творческий успех и признание заслуг, духовный рост, расширение сознания, идеализм, альтруизм и искреннее сострадание. Благоприятный период для творчества, поиска идеалов, духовного покровительства и учения.",
atx[285]="Разочарование в прежних идеалах, растерянность, ошибочная самооценка, иллюзии и нереалистичные ожидания, нехватка вдохновения и энтузиазма. Возможна потеря авторитета и шаткое социальное положение, зависть и сплетни.  Избегайте проявления гордыни и тщеславия и, наоборот, уныния и чувства ничтожности, будьте честны с собой и другими, опирайтесь на бесспорные мировоззренческие ценности.",
atx[186]="Интуиция, воображение и вдохновение находят практическое применение. Душевная глубна, психологическая и духовная стабилизация, укрепление системы ценностей, обретение целостности. Заслуженные успехи в творческой, психологической и религиозной деятельности. Благоприятный период для уединения, самопознания, духовной практики.",
atx[286]="Пессимизм, чувство вины, одиночество, потеря уверенности в себе, разочарование в ценностях, расплывчатость целей, сомнения в их правильности и достижимости, фатализм. Возможны нерациональные страхи, мнительность, беспокойство, желание избежать обязанностей и ответственности, страдает репутация и статус. Остерегайтесь алкоголя, отравления лекарствами, опасных психических практик.",
atx[187]="Освобождение от догм, заблуждений, зависимости, иллюзий. Увлеченность идеями и развитие целостного взгляда на мир. Возможно пробуждение и развитие интуитивных и сенситивных способностей, внезапные озарения и откровения.  Благоприятный период для сотрудничества творческого, научного, гуманитарного, религиозного характера, изучения оккультных дисциплин, для духовной практики.",
atx[287]="Психологическая и эмоциональная путаница, дезориентация, сомнения в выбранных ориентирах и ценностях, непоследовательность, неорганизованность, возможны неожиданные столкновения с необъяснимыми явлениями. Избегайте анархичных действий, однобоких концепций и непроверенных психических практик.",
atx[189]="Глубокие эмоциональные переживания, возрождение, обретение смысла. Интерес к мировым и глобальным проблемам, запредельным возможностям человека, вовлечение в массовые культурные и религиозные движения. Подъем и успех у людей творческих профессий. Интуиция и чувствительность у руководителей, организаторов, людей опасных профессий. ",
atx[289]="Возможен глубокий эмоциональный кризис, неконтролируемые подсознательные импульсы, эмоциональные потрясения. Сильное вмешательство в жизнь не подвластных и непонятных вам экономических, политических и культурных изменений. Духовное напряжение и осознание.",
atx[80]=atx[280],atx[81]=atx[281],atx[82]=atx[282],atx[83]=atx[183],atx[84]=atx[284],atx[85]=atx[285],atx[86]=atx[286],atx[87]=atx[287],atx[88]=atx[288],atx[89]=atx[289],atx[190]="Рост самосознания, силы воли, выносливости, раскрытие потенциальных возможностей. Благоприятный период для проявления лидерской позиции, духовного, интеллектуального и физического самосовершенствования.",
atx[290]="Неудовлетворенность собой и жизнью, экстремальные ситуации, конфликты, . Сильное вмешательство сил, не зависящих от вашей воли. Период глубокого кризиса и трансформации сознания.",
atx[199]="Рост самосознания, силы воли, выносливости, раскрытие потенциальных возможностей. Благоприятный период духовного, интеллектуального и физического самосовершенствования.",
atx[299]="Кризис трансформации, психическое напряжение, потребность радикального обновления идей и обстоятельств, вопросы жизни и смерти, вынужденное осознание духовных реальностей. Вероятны конфликты, материальные проблемы, сексуальная неудовлетворенность. Время для переоценки своих сил и возможностей.",
atx[191]="Глубокие душевные переживания и трансформация подсознания, интенсивные чувства, потребность в душевном самораскрытии, рост интуитивных способностей. Благоприятный период для изменений в повседневных условиях жизни, привычках и работы с подсознанием.",
atx[291]="Глубокая эмоциональная трансформация, душевная опустошенность, мощные неконтролируемые подсознательные процессы и интенсивные чувства, желание разорвать или обновить существующие эмоциональные связи и отношения, условия повседневной жизни. ",
atx[192]="Усиление проницательности, рост интеллектуальных и интуитивных способностей. Благоприятный период для образовательной, научной и исследовательской деятельности, распространения и внедрения идей, глубокого интеллектуального общения.",
atx[292]="Интенсивное интеллектуальное напряжение и беспокойство, стрессы, возможны навязчивые идеи, подозрительность, сарказм. Неблагоприятное время для решения крупномасштабных проблем и проектов. Избегайте бескомпромиссности в контактах и рискованных предприятий.",
atx[193]="Мощный творческий потенциал, вдохновение, сильные эмоции, интенсивные переживания. Глубокое понимание отношений, их трансформация, обновление и гармонизация. Возможно ощущение глубокой связи с миром в целом.",
atx[293]="Эмоциональная напряженность, непонимание чувств других людей, нарушение гармонии в отношениях. Возможны сексуальные и материальные проблемы. Постарайтесь не поддаваться эмоциям и направить напряжение в творчество. ",
atx[194]="Увеличение энергии, силы воли и решимости, проявление личного лидерства. Благоприятный период для глубоких перемен в своей жизни, саморазвития и повышения эффективности. В экстремальных ситуациях не помешает осторожность.",
atx[294]="Напряженная борьба, импульсивные действия, конфликты, опасности, стрессы. Попытки реформировать собственную жизнь, окружение и обстоятельства будут встречать мощное сопротивление, поэтому возможны агрессивность, истощение и депрессии. Пострайтесь сохранять объективность, избегайте экстремальных и опасных ситуаций: есть риск аварий, травм и вовлечения в массовые катклизмы.",
atx[195]="Глубокое осознание общественных, культурных и духовных ценностей. Изменения в мировоззрении. Благоприятный период для упрочения своего авторитета и влияния, для образовательной, научной, политической и религиозной деятельности.",
atx[295]="Кризис мировоззрения, ошибки в общественной деятельности или оппозиция власти и ухудшение социального положения и подрыв авторитета. Возможны радикальные перемены в философских и религиозных взглядах. Избегайте высокомерия, нечестных действий и пренебрежения к важным деталям.",
atx[196]="Рост концентрации и силы воли. Появляется возможномть удовлетворить профессиональное честолюбие. Это удачное время для самосовершенствования и содействия реформам в социальной сфере, а также осуществления долгосрочных программ и решения юридических вопросов. Возможна большая эффективность в работе, организация собственного дела и глубокое постижение законов материи и духа. Это время коренных личностных трансформаций. В этот период человек склонен взять на себя много, осознавая свою роль полноправного участника общего исторического процесса, и это оправдано. Однако не следует переоценивать своих сил и слишком увлекаться борьбой, поскольку существует повышенная опасность прямых столкновений, нападений и травматизма, особенно если в рамках этого периода действуют неблагоприятные транзиты Марса. Следует избегать слишком жесткого и требовательного отношения к себе и другим.",
atx[296]="Это выматывающий период силового взаимодействия с людьми и необходимости защищать свои права в неблагоприятных обстоятельствах, навязанного сотрудничества и вынужденного участия в деловых махинациях. Возможны злоупотребления своей силой или энергетический кризис, и надо избегать самовозвеличивания, равно как и самоуничижения, а также людей с плохим характером или недостаточно честными намерениями. Это время может оставить тяжелые последствия. При транзитах Марса человек может вовлекаться в экстремальные ситуации: возможны нападения, травмы и болезни. Это опасный период жизни, и не следует испытывать судьбу, поддаваясь мысли, что терять нечего и хуже не будет. В это время следует по возможности уклоняться от всех излишеств, сохраняя внутреннее спокойствие и порядочность. Не следует по своей воле вступать в борьбу: это, скорее всего, не встретит поддержки у других людей, и она кончится поражением. Также следует избегать сурового и жесткого отношения к себе и людям.",
atx[197]="Это период, когда волевые усилия могут привести к более высокому уровню самореализации и развитию творческой оригинальности, изобретательности и предприимчивости. Возможно естественное окончание старых условий существования и приход к новому образу деятельности. Перемены могут быть связаны с трансформацией социальных, экономических или политических условий. Возможно радикальное изменение взгляда на природу и общественные взаимоотношения. Это время требует от человека принципиально новых решений в тем большей степени, чем более он участвует в жизни и принимает на себя ответственность за происходящее. Может возникнуть необходимость идти на риск и борьбу, однако, скорее всего, она будет оправдана и приведет к победе.",
atx[297]="Это период, когда ощущается потребность в регенерации и смене привычек существования, порой вызываемая чувством материального дискомфорта или социальной небезопасности. Однако это не самое лучшее время для того, чтобы начать новую жизнь. В это время тяжело дается осуществление глобальных перспектив, солидных предприятий и дальних путешествий. Имеет смысл приложить больше усилий к внутреннему обновлению личности и поиску оригинальных решений возникающих проблем, избегая, однако черезмерной эксцентричности. Это время стимулирует развитие изобретательности и предприимчивости, которые, однако, продуктивно могут быть приложены только в будущем. Этот период дает возможность уничтожить изношенное и бесполезное, разрушить обременительные связи и взаимоотношения. Привычный ход жизни в это время может нарушаться столкновением с природной стихией, а также социальными и экономическими неурядицами. Это заставляет переоценить свое отношение к природе и обществу, порой развивая идейный протест, который может стать основой будущего гражданского мировоззрения или политической активности. Этот период закладывает основы трансформации внешних условий существования.",
atx[198]="Это страстный период, вызывающий повышенный интерес к любви, а также религии и мировым проблемам. В это время вероятно вовлечение в массовые культурные процессы, от тяги к мистике до увлечения эстрадой или рок-группами. Глубина эмоциональных переживаний в это время чаще всего не приносит серьезных психологических проблем, однако заставляет обратить внимание на действующие в мире силы, мало подвластные человеку. Возможна потребность исследования своих мыслей и чувств или разоблачения таинственных процессов жизни и смерти. События этого периода закладывают основы отношения к любви и браку, и благополучие в этих вопросах является залогом будущего счастья. В это время развивается способность жертвовать собой ради другого. Оно благоприятно для духовной практики, интереса к сексуальной проблематике и запредельным возможностям человека, и осознания глобальных человеческих проблем. Период самоотверженности, жертвенности и потребности отдать себя иному, когда примерно одновременно действует трин Нептуна к Плутону и соединение Плутона с Непутном, у всего послевоенного поколения соответствует в среднем 25-летнему возрасту. У довоенного он проходил несколько раньше и был не столь сильно выражен. У тех, кто родился после 1994 года, он попадёт на зрелый возраст. Это поколение будут меньше волновать проблемы любви.",
atx[298]="Этот период может быть связан с глубокими эмоциональными потрясениями. Причиной этого может служить любовь и отношения с близкими людьми, но также чувствительность к мировым политическим и общечеловеческим проблемам. Под давлением этого периода может осознаваться невозможность понять и объяснить происходящее, существование сверхъестественных сил или, напротив, необходимость атеистической позиции. Возможна неоправданная ревность. Страсть может мыслиться разрушительной и действительно перевернуть всю жизнь. Также возможно вынужденное участие в массовых процессах. В это время возникает необходимость в постоянном контроле подсознательных эмоциональных импульсов и исследовании их причин. В этот период особенно важно внимание к своей инстинктивной природе и гармоничное удовлетворение социальных и личных потребностей. Желательно избегать ситуаций возможного насилия. Благоприятен интерес к религии, массовым движениям и моде, сексуальной проблематике, а также героике и проявлению возможностей человека в экстремальной ситуации. Этот период духовного осознания жизни у поколения 1945-1994 годов бывает примерно в возрасте 12-13 лет и 51 года.",
